import React, {useState} from 'react';
import ReactMapGL, {Marker, Popup} from 'react-map-gl';
import FarmData from 'src/data/FarmData'
// import the marker data. Every row needs to have a lat and long where marker will be rendered.
//

function Map() {

  const [viewport, setViewport] = useState({
    width: '90vw',
    height: '80vh',
    latitude:  42.2994,
    longitude: -75.2179,
    zoom: 6
  })

  var markers = FarmData.map(farm => {
    return(
        <Marker
          id={farm.id}
          latitude={farm.latitude}
          longitude={farm.longitude}
          >
          <img className="soil-icon" src="soil-icon.png" alt="soil icon"/>
          <div> </div>
        </Marker>

    )
  })

    return(
      <div>
      <h1> Rendering the map here! </h1>
      <ReactMapGL
        {...viewport}
        mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}
        mapStyle="mapbox://styles/namrata-haribal/ck1uz9gna7ukn1cqrpb4gx5np"
        onViewportChange={(viewport) => {setViewport(viewport)}}>
        {markers}
      </ReactMapGL>
      </div>

    )

  }


export default Map
